void loop2(HostCmdEnum& myHostCmd)
{





    if (Serial.available() > 0) {

        myHostCmd = (HostCmdEnum)(Serial.read());

    }


    switch (myHostCmd) {
    case HostCmdEnum::STATUS_REQUEST:

        ReportStatus();
        break;
    case HostCmdEnum::ALL_GROUNDED:
        AllGrounded();
        Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Button5")))));
        break;
    case HostCmdEnum::RQST_MAX_EXEC_LOOP_TIME:
        Serial.print(((reinterpret_cast<const __FlashStringHelper *>(("EXEC_LOOPMAX: "))))),
            Serial.println(gLongest_loop_time, 10);
        break;
    case HostCmdEnum::NO_OP:
        break;
    default:

        break;
    }


    RadioOne_Handler(myHostCmd);
    RadioTwo_Handler(myHostCmd);
    RadioThree_Handler(myHostCmd);
    RadioFour_Handler(myHostCmd);
    Aux1_Handler(myHostCmd);
    Aux2_Handler(myHostCmd);
    All_Grounded_Handler(myHostCmd);




    myHostCmd = HostCmdEnum::NO_OP;
}

void RadioOne_Handler(HostCmdEnum host_cmd)
{



    enum class RadioState : uint8_t {
        NOTHING,
        IDLE,
        XMIT
    };

    static RadioState currState = RadioState::IDLE;
    static bool do_once = false;


    switch (currState) {
    case RadioState::IDLE:
        if ((digitalRead(4) == 0x0 && digitalRead(5) == 0x1 && digitalRead(6) == 0x1 && digitalRead(7) == 0x1) && (digitalRead(13) == 0x1)) {
            if (do_once == false) {
                if (digitalRead(15) == 0x0){
                    Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Button1")))));
                    WebText(" Receivers to Antenna\n");
                }
                AllGrounded();
                digitalWrite(15, 0x1);

                do_once = true;
            }
            currState = RadioState::XMIT;
        } else if ((digitalRead(4) == 0x1 && digitalRead(5) == 0x1 && digitalRead(6) == 0x1 && digitalRead(7) == 0x1) && host_cmd == HostCmdEnum::SELECT_RADIO_1 && (digitalRead(13) == 0x1)) {
            AllGrounded();
            digitalWrite(15, 0x1);
            Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Button1")))));

        }
        break;

    case RadioState::XMIT:
        displayState("\tR1XMIT state");
        if ((digitalRead(4) == 0x1 && digitalRead(15) == 0x1) && do_once == true) {

            do_once = false;
            displayState("\tR1IDLE state");
            currState = RadioState::IDLE;
        }
        break;

    default:
        break;
    }
}


void RadioTwo_Handler(HostCmdEnum host_cmd)
{
    enum class RadioState : uint8_t {
        NOTHING,
        IDLE,
        XMIT,
        BOOT_WAIT,
        REM_POWER_OFF_WAIT,
    };


    static RadioState currState = RadioState::IDLE;
    static bool do_once = false;

    static unsigned long timerStart = 0;
    static unsigned long timerDelay = 0;


    switch (currState) {
    case RadioState::IDLE:

        if ((digitalRead(4) == 0x1 && digitalRead(5) == 0x0 && digitalRead(6) == 0x1 && digitalRead(7) == 0x1) && (digitalRead(13) == 0x1)) {
            if (do_once == false) {
                if (digitalRead(16) == 0x0){
                    Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Button2")))));
                    WebText(" Flex-6600 to KPA500\n");
                }
                AllGrounded();
                digitalWrite(16, 0x1);
                digitalWrite(11, 0x1);
                Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::LEDRed")))));

                do_once = true;
            }
            currState = RadioState::XMIT;


        } else if (((digitalRead(3) == 0x0 && digitalRead(14) == 0x0)) || host_cmd == HostCmdEnum::AUX_2_ON) {
            digitalWrite(14, 0x1);
            digitalWrite(12, 0x1);
            Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("Radio Booting...")))));
            timerStart = millis();
            timerDelay = BOOT_WAIT_DELAY;
            Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Aux2 On")))));
             WebText(" Flex-6600 is Booting\n");
            Serial.print(((reinterpret_cast<const __FlashStringHelper *>(("\tTimerDelay: ")))));
            Serial.println(timerDelay, 10);
            currState = RadioState::BOOT_WAIT;

        } else if ((digitalRead(9) == 0x0 && digitalRead(14) == 0x1) || host_cmd == HostCmdEnum::AUX_2_OFF) {

            digitalWrite(14, 0x0);
            digitalWrite(12, 0x0);
            timerStart = millis();
            timerDelay = REM_PWR_OFF_DELAY;
            Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Aux2 Off")))));
            Serial.print(((reinterpret_cast<const __FlashStringHelper *>(("\tTimerDelay: ")))));
            WebText(" Flex-6600 shutting Down\n");
            Serial.println(timerDelay, 10);
            currState = RadioState::REM_POWER_OFF_WAIT;

        } else if ((digitalRead(4) == 0x1 && digitalRead(5) == 0x1 && digitalRead(6) == 0x1 && digitalRead(7) == 0x1) && host_cmd == HostCmdEnum::SELECT_RADIO_2 && (digitalRead(13) == 0x1)) {
            AllGrounded();
            digitalWrite(16, 0x1);
            Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Button2")))));
            WebText(" All Grounded\n");
        }
        break;

    case RadioState::XMIT:
        displayState(((reinterpret_cast<const __FlashStringHelper *>(("\tR2XMIT state")))));
        if ((digitalRead(5) == 0x1 && digitalRead(16) == 0x1) && do_once == true) {
            digitalWrite(11, 0x0);
            Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::LEDBlack")))));
            do_once = false;
            displayState(((reinterpret_cast<const __FlashStringHelper *>(("\tR2IDLE state")))));
            currState = RadioState::IDLE;
        }
        break;

    case RadioState::BOOT_WAIT:
        if (!do_once) {
            displayState(((reinterpret_cast<const __FlashStringHelper *>(("\tR2BOOT_WAIT state")))));
            do_once = true;
        }


        if (millis() - timerStart >= timerDelay) {
            Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Aux2 Ready On")))));
            WebText(" Flex-6600 is On\n");





            displayState(((reinterpret_cast<const __FlashStringHelper *>(("\tR2IDLE state")))));
            do_once = false;
            currState = RadioState::IDLE;
        }
        break;

    case RadioState::REM_POWER_OFF_WAIT:
        if (!do_once) {
            displayState(((reinterpret_cast<const __FlashStringHelper *>(("\tR2REM_POWER_OFF_WAIT state")))));
            do_once = true;
        }
        if (millis() - timerStart >= timerDelay) {
            Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("CON::Aux2 Ready Off")))));
            WebText(" Flex-6600 is Sleeping\n");
            do_once = false;
            displayState(((reinterpret_cast<const __FlashStringHelper *>(("\tR2IDLE state")))));

            currState = RadioState::IDLE;
        }
        break;

    default:
        Serial.println(((reinterpret_cast<const __FlashStringHelper *>(("'Default' Switch Case reached - Error")))));
        break;
    }
}


