void get_hardware_status(RAS_HW_STATUS_STRUCT& myhw ) {
    myhw.R1_Status = (digitalRead(15));
    myhw.R2_Status = (digitalRead(16));
    myhw.R3_Status = (digitalRead(1));
    myhw.R4_Status = (digitalRead(2));

    myhw.A1_On_Status = (digitalRead(13));
    myhw.A1_Off_Status = 0;

    myhw.A2_On_Status = (digitalRead(14));
    myhw.A2_Off_Status = 0;

    myhw.ALL_GND_Status = (digitalRead(15) == 0x0 && digitalRead(16) == 0x0 && digitalRead(1) == 0x0 && digitalRead(2) == 0x0);
}

